import React from "react";
import { Box, Typography } from "@mui/material";
import { SummonerSpell } from "../../types/SummonerSpell";

interface SummonerSpellsProps {
sum1: SummonerSpell,
sum2: SummonerSpell
}

const SummonerSpells: React.FC<SummonerSpellsProps> = ({sum1, sum2}) => {
  return (
    <Box sx={{ border: "1px solid #ccc", p: 1 }}>
      <Box component={"img"} src={sum1.icon} sx={{ height: "2.5rem" }} />
      <Box component={"img"} src={sum2.icon} sx={{ height: "2.5rem" }} />
    </Box>
  );
};

export default SummonerSpells;
